export default class SearchBar extends Component{
    render(){
        return (
            <div>
                <form>
                    <select id="search-by" name="search-by">
                        <option value="name">Name</option>
                        <option value="name">Name</option>
                        <option value="name">Name</option>
                        <option value="name">Name</option>
                    </select>
                </form>
            </div>
        )
    }
}
